package src.main.java;

import java.util.HashSet;
import java.util.LinkedList;
import java.util.List;
import java.util.Set;

/**
 * All DNA is composed of a series of nucleotides abbreviated as A, C, G, and T, for example:
 * "ACGAATTCCG". When studying DNA, it is sometimes useful to identify repeated sequences within
 * the DNA.
 * <p>
 * Write a function to find all the 10-letter-long sequences (substrings) that occur more than
 * once in a DNA molecule.
 * <p>
 * For example,
 * <p>
 * Given s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT",
 * <p>
 * Return:
 * ["AAAAACCCCC", "CCCCCAAAAA"].
 */
public class RepeatedDNASequence {
    // this strategy got memory limit exceed
    // however if you save hashCode in the set, no memory limit problem
    public List<String> findRepeatedDnaSequences(String s) {
        int length = s.length();
        if (length <= 10) return new LinkedList<>();

        Set<Integer> counts = new HashSet<>();
        List<String> out = new LinkedList<>();

        for (int i = 0; i <= length - 10; i++) {
            String subS = s.substring(i, i + 10);
            if (counts.contains(subS.hashCode()) && !out.contains(subS)) {
                out.add(subS);
            } else {
                counts.add(subS.hashCode());
            }
        }
        return out;
    }

    // this strategy got time limit exceeded
    public List<String> findRepeatedDnaSequences2(String s) {
        int length = s.length();
        if (length <= 10) return null;
        String subS;
        List<String> out = new LinkedList<>();

        for (int i = 0; i <= length - 10; i++) {
            subS = s.substring(i, i + 10);
            int index = s.indexOf(subS);

            if (index >= 0 && index != i) {
                if (!out.contains(subS)) {
                    out.add(subS);
                }
            }
        }
        return out;
    }

    public static void main(String[] args) {
        String s = "";
        RepeatedDNASequence repeatedDNASequence = new RepeatedDNASequence();
        System.out.println(repeatedDNASequence.findRepeatedDnaSequences(s));
    }
}
